import React, { useState, useEffect } from 'react';


export default function Popup(props) {
    let { onChange } = useState();
    useEffect(() => {
        onChange = props.onSelect;
    }, [props.onSelect])

    const handleChange = () => {
        onChange();
    }

    return (
        <button className="" onClick={() => handleChange()}>
            Hi
        </button>
    );
}
